Bonjour, je m'appelle Justine
Je recherche un complément de revenus sur mon temps libre;
J'accompagne actuellement un proche dans la maladie, ce qui fait que j'ai du mettre ma carrière de côté;
Mais je reste motivée et volontaire pour effectuer ménage, linge, repassage (possibilité de le faire à mon domicile sous 24h); 
Mais également accompagner nos ainées dans des taches du quotidien comme les courses, aide à la préparation des repas, etc...
N'hésitez pas a me contacter !
Justine
